import React, { useState } from 'react';
import './App.css';

const ToDos = () => {
  const todos = [1, 2, 3, 4, 5, 6, 7, 8]
  return ( 
    <ul>
      {
        todos.map(todo => <li>{todo}</li>)
      }
    </ul>
  );
}

export default ToDos;
